Course.create({"id"=>1, "name"=>"English 101", "code"=>"1111", "featured"=>true, "short_desc"=>"Learn the basics.", "long_desc"=>"Shields up. I recommend we transfer power to phasers and arm the photon torpedoes. Something strange on the detector circuit. The weapons must have disrupted our communicators. You saw something as tasty as meat, but inorganically materialized out of patterns used by our transporters. Captain, the most elementary and valuable statement in science, the beginning of wisdom, is I do not know. All transporters off.", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00" })
Course.create({"id"=>2, "name"=>"Math 101", "code"=>"2222", "featured"=>false, "short_desc"=>"Build fundamentals.", "long_desc"=>"Unidentified vessel travelling at sub warp speed, bearing 235.7. Fluctuations in energy readings from it, Captain. All transporters off. A strange set-up, but Id say the graviton generator is depolarized. The dark colourings of the scrapes are the leavings of natural rubber, a type of non-conductive sole used by researchers experimenting with electricity. The molecules must have been partly de-phased by the anyon beam.", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00" })
Course.create({"id"=>3, "name"=>"Science 101", "code"=>"3333", "featured"=>false, "short_desc"=>"Why ask why?", "long_desc"=>"Now what are the possibilities of warp drive? Cmdr Rikers nervous system has been invaded by an unknown microorganism. The organisms fuse to the nerve, intertwining at the molecular level. Thats why the transporters biofilters couldnt extract it. The vertex waves show a K-complex corresponding to an REM state. The engineering sections critical. Destruction is imminent. Their robes contain ultritium, highly explosive, virtually undetectable by your transporter.", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00" })
Course.create({"id"=>4, "name"=>"Art 101", "code"=>"4444", "featured"=>true, "short_desc"=>"Grab your paintbrush.", "long_desc"=>"Run a manual sweep of anomalous airborne or electromagnetic readings. Radiation levels in our atmosphere have increased by 3,000 percent. Electromagnetic and subspace wave fronts approaching synchronization. What is the strength of the ships deflector shields at maximum output? The wormholes size and short period would make this a local phenomenon. Do you have sufficient data to compile a holographic simulation?", "created_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00", "updated_at"=>"Thu, 14 May 2020 18:57:35 UTC +00:00" })
